import React from "react";
import { useState } from "react";

const DemoUsest = () => {
  const [count, setCount] = useState(0);

  const Addtion = () => {
    setCount(count + 1);
  };
  const subst = () => {
    setCount(count - 1);
  };
  return (
    <div>
      <button onClick={Addtion}>addd</button>
      <p>{count}</p>
      <button onClick={subst}>substract</button>
    </div>
  );
};

export default DemoUsest;
